import React, { useState, useEffect } from "react";
import useClassBehavior from "../useClassBehavior";
import useClassesBehavior from "../Classes/useClassesBehavior";
import "./Settings.css";

export default function Settings() {
  const classBehavior = useClassBehavior("class-container");
  const classesBehavior = useClassesBehavior("stream-container");
  const [behaviors, setBehaviors] = useState([]);

  // Load behavior data from localStorage
  useEffect(() => {
    const loadData = () => {
      const data = JSON.parse(localStorage.getItem("userBehaviors")) || [];
      setBehaviors(data);
    };

    loadData();

    // Update automatically if new data is saved
    const interval = setInterval(loadData, 1000);
    return () => clearInterval(interval);
  }, []);

  const handleClearData = () => {
    localStorage.removeItem("userBehaviors");
    setBehaviors([]);
  };

  return (
    <div className="settings-container">
      <h2>User Behavior Monitor</h2>

      {/* Real-Time Behavior Summary */}
      <div className="behavior-summary">
        <h3>ðŸ“Š Real-Time Behavior Data</h3>
        <div className="behavior-box">
          <p><strong>Scroll Velocity (Class):</strong> {classBehavior.scrollVelocity.toFixed(1)} px/s</p>
          <p><strong>Scroll Velocity (Stream):</strong> {classesBehavior.scrollVelocity.toFixed(1)} px/s</p>
          <p><strong>Hover Duration:</strong> {Math.max(classBehavior.hoverDuration, classesBehavior.hoverDuration)}s</p>
          <p><strong>Click Error Rate:</strong> {(classBehavior.clickErrorRate || classesBehavior.clickErrorRate).toFixed(1)}%</p>
          <p><strong>Current Action:</strong> {classBehavior.action || classesBehavior.action}</p>
        </div>
      </div>

      {/* Saved Behavior Table */}
      <div className="behavior-log">
        <h3>ðŸ•’ Saved Behavior Data</h3>
        {behaviors.length === 0 ? (
          <p>No recorded behaviors yet.</p>
        ) : (
          <table className="behavior-table">
            <thead>
              <tr>
                <th>Scroll Velocity (&lt;30px/s)</th>
                <th>Hover Duration (&lt;3s)</th>
                <th>Click Error Rate (&lt;15%)</th>
                <th>Date and Time Recorded</th>
              </tr>
            </thead>
            <tbody>
              {behaviors.map((b, index) => (
                <tr key={index}>
                  <td>{b.key.includes("Scroll") ? b.value : "-"}</td>
                  <td>{b.key.includes("Hover") ? b.value : "-"}</td>
                  <td>{b.key.includes("Click") ? b.value : "-"}</td>
                  <td>{b.timestamp}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>

      {/* Clear Data Button */}
      <button className="clear-button" onClick={handleClearData}>
        ðŸ§¹ Clear All Data
      </button>
    </div>
  );
}
